import React from 'react'

export default function Panel({style, children}) {
    const styles = {
        container: {
            display: "flex",
            backgroundColor: "#FFF",
            borderRadius: "8px",
            padding: "1em"
        }
    }

    return <div style={{...styles.container, ...style}}>
        {children}
    </div>
}
